"fa99cd42cb77490f8c48b712370342e9",hN="e721219aad9840f5ab5e9b0f33602fd1",hO="images/a03_01__회원정보관리/u3190.png",hP="2b59549bc31543e38aff5c6bd78bea4c",hQ=90,hR="images/a03_01__회원정보관리/u3060.png",hS="47f89ba203c448fba975517a37f2991e",hT="images/a03_01__회원정보관리/u3072.png",hU="5a002039bcf84660865a5ad4d3aac454",hV="images/a03_01__회원정보관리/u3084.png",hW="22fdb376dc6b49caa99e148fc41b4cea",hX="2b26078c676348a3b372d6dae3b4c963",hY="da3b152cc26c40aeb572d3e86c34404d",hZ="images/a03_01__회원정보관리/u3120.png",ia="af953b98d2cf47d8a57bb21dbf8d5d5a",ib="ad5c836ad9d34b249eaf3bfbb6e8b31e",ic="1087220d3e1b4f14856f9440353621a1",id="09bb86bb21114dc09013cf90182804e3",ie="6da1866d17464fffb3fbee20a5a1479f",ig=501,ih="images/a03_01__회원정보관리/u3180.png",ii="<p><span>* 인슈케어 대상의 서비스로 가정한 상태에서 아래 내용 참고. (다른 형태의 서비스는 필요시 추후 별도 협의)</span></p><p><span><br></span></p><p><span>1. 회원 Record 출력 전제조건</span></p><p><span>&nbsp;- 고객DB가 일괄로 넘어오기 때문에 여기에 조회되는 회원들은 넘어온 모든 고객을 대상으로 함</span></p><p><span>&nbsp;- 만성질환 서비스를 이용하기 위해서는 인슈케어 각 서비스 사이트에서(또는 관리자를 통해) 약관 동의 및 질환구분, 건강정보 입력을 완료해야 서비스 등록이 되므로, 해당 회원의 경우 조회는 되나 본 화면 D203(전지현) 처럼 서비스 기간 및 질환군의 값이 null이며 [서비스 등록] 버튼을 통해 관리자가 등록을 할 수 있도록 함</span></p><p><span><br></span></p><p><span>2. 컬럼 [상태]값 설명</span></p><p><span>&nbsp;- 유지: 서비스 등록이 완료된 경우이며 괄호 안에는 서비스 만료(기간종료)일까지의 잔여일을 계산하여 출력</span></p><p><span>&nbsp;- 예정: 서비스 등록은 되었으나 관리자가 서비스 시작일을 등록일과 다르게 그 이후로 설정한 경우로 조회 날짜 오늘을 기준으로 아직 시작되지 않은 경우</span></p><p><span>&nbsp;- 만료: 서비스 기간이 다한 경우</span></p><p><span>&nbsp;- 탈퇴: 고객 의사에 따라 더 이상 서비스를원하지않은 경우로 기존에보유한&nbsp; 개인 정보 외에 만성질환 서비스상에서 수집한 정보는 삭제함을 원칙으로 함</span></p><p><span>&nbsp;- 중단: 고객요청 또는 관리자 임의로 일시 서비스를 중단한 경우</span></p><p><span><br></span></p><p><span>3. 컬럼 [측정횟수]</span></p><p><span>&nbsp;- 측정 Record 1건을 1회로 간주하여 서비스 기간 내 총 측정한 횟수로 출력(인터넷, ARS, IVR 합산)</span></p>",ij="45f5bb51fa8c45a397c6cc2ac3fca60f",ik="(검색)날짜시작",il="Text Field",im="textBox",io=0xFF868686,ip="44157808f2934100b68f2394a66b2bba",iq=22,ir=330,is=192,it="HideHintOnFocused",iu="2422de7449c74b2caac6c0f96c614d80",